function whittle(input){
  var foo = input;
  var index=-1;
  var nextChar;
  var stop = false;

  while(!stop){
    index++;
    let current = foo.charAt(index);
    let next = foo.charAt(index+1);

    if (index === foo.length-1) {
      stop = true;
      console.log('no more reactions');
      return {final:foo};
    }

    if (current.toUpperCase() === next.toUpperCase()) {
      foo = foo.replace(`${current}${next}`,'');
      stop = true;
    }
  }

  return foo;
}
// approach that just goes traversing the string
