// stacking
function stacking(input) {
  // the last item of this array is always the character before the character
  // that is being compared in stack()
  const peek = stack => stack[stack.length - 1];

  function createStack(){
    const stack = []

    input.split('').forEach(char => {
        // compare the bits of the characters (using ^), if they are 32 it means
        // they are the same letter but different casing
        if (!stack.length || (peek(stack).charCodeAt() ^ char.charCodeAt()) !== 32) {
            stack.push(char)
        } else {
          // if the previous char and the current char causing a reaction, remove
          // the previous char, breaking the pair
            stack.pop()
        }
        // console.log(stack.length);
    })

    return stack.join('')
  }

  return createStack();
}

